export default function HomeSite() {
    return(
        <div>
            <div className="banner">
                <h1>Projekt na zaliczenie semestru</h1>
                <p>
                    Ten projekt został utworzony przez Jakuba Stawskiego, studenta I roku inż. Informatyki w trybie niestacjonarnym z wykorzystaniem metod nauki online. <br />
                    Opis projektu: <br />
                    Projekt wykorzystuję 
                </p>

            </div>
        </div>
    )
}
